import React from 'react';

import { AiTwotoneHome } from "react-icons/all";

import { Wrapper, Header, Button, Box, Text, TextField  } from './styles';

import logo from '../../assets/images/logo.png';

function Main() {
  return (
      <Wrapper>
        <Header>
                <img src={logo}/>
        </Header>
        
        <body>
            <Box >
                <Text>Entrar</Text>
                <form >
                    <input type="text" id="usuario" label="Standard" />
                    
                </form>
            </Box>
                  <Button>
                        <span>Entrar</span>
                  </Button>

            
        </body>
      </Wrapper>  
  )
}

export default Main;
